import React, {Component} from 'react';

class Homepage extends Component{
    constructor(){
        super();
        this.state ={
          error: null,
          isLoaded: false,
          items: [],
        }
    }
    componentDidMount(){
      fetch("https://api.spaceXdata.com/v3/launches?limit=100")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result
          });
        },
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
    }
    render(){

      let count = 0;


      const { error, isLoaded, items } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        return (
          <div>
            <ul>

            {items.map((item) => (
            <li key={item.flight_number}>
                {item.launch_year}
            </li>
            ))}
            </ul>

          </div>
        );
      }
    }
}

export default Homepage;
